    return(
        <TableRow>
            <TableCell>{id}</TableCell>
            <TableCell><img src={image} alt='profile'/></TableCell>
            <TableCell>{name}</TableCell>
            <TableCell>{birthday}</TableCell>
            <TableCell>{gender}</TableCell>
            <TableCell>{job}</TableCell>
        </TableRow>
    )
}

